import React from 'react';

const utisci = [
  {
    ime: "Pera Peric",
    utisak: "sjasni mikrokontroleri"
  },
  {
    ime: "Mika Mikic",
    utisak: "odlicni saveti, kreativni inzenjeri, spremni da pomognu"
  },
  {
    ime: "Laza Lazic",
    utisak: "nista ne valja, roba je kineska"
  }

]

const mapirano = utisci.map(x => {
  return (
    <div>
      <p>{x.ime} : {x.utisak}</p>
    </div>
  )
});


export default function Main(props) {
    return (
        <main>
          <h2>Utisci potrosaca:</h2>
          mapirano
        </main>
    )
}
